import React from "react";
import commonQuestionsData from "./commonQuestionsData";
export default function CommonQuestions() {

  const data = commonQuestionsData.textData;

  return (
    <section className="commonQuestions initial__section">
      <ul className="commonQuestions__list">
        {
          data.map((item, key) => (
            li.commonQuestions__item>button.commonQuestions
          ))
        }
      </ul>
    </section>
  )
}
